  SearchBar,
  SearchForm,
  SearchFormButton,
  SearchFormInput,
} from './styled';
import { Formik, Field } from 'formik';
import { GoSearch } from 'react-icons/go';

export const Searchbar = () => {
  return (
    <SearchBar>
      <Formik initialValues={initialValues} onSubmit={handleSubmit}>
        <SearchForm>
          <SearchFormButton type="submit">
            <GoSearch size={'23px'} />
          </SearchFormButton>
          <SearchFormInput>
            <Field></Field>
          </SearchFormInput>
          type="text" autocomplete="off" autofocus placeholder="Search images
          and photos"
        </SearchForm>
      </Formik>
    </SearchBar>
  );
};
